import React, { useState, useRef } from 'react';
import bubble from '../img/prepop.svg'
import pop from '../img/popped.svg'

import './Analytics.css'

const Analytics = () => {
    let arr = [...Array(199).keys()]
    return (
        <div className="bubble-wrap-container">
            <h1 >Bubble Wrap</h1>
            <img className="bubbles" src={bubble}></img>
            {arr.map((index) => {
                return <img className="bubbles" src={pop}/>
            })}
        </div>
    )

}
export default Analytics;
